		["RaidCDs_GroupPoll"] = {
			["outline"] = "OUTLINE",
			["xOffset"] = 0,
			["displayText"] = "%c",
			["customText"] = "function ()\n    \n    --[[ Note from Tehr:\n    \n    I'm sorry to say there is NO WAY to obtain information about another player's\n    artifact (such as number of traits) in-game that I or anyone else knows about,\n    so I am forced to assume every player has 4 points in every artifact trait.\n    This is not ideal, since the player may have one or more relics for that trait,\n    but I really have no realistic alternative. I apologize for any inconvenience\n    this may cause, and please understand that if I find a way to obtain this\n    information, I will immediately incorporate it into this WeakAura.\n    \n    ]]--\n    \n    aura_env.pollRate = aura_env.pollRate or 2    \n    if (_raidCDs_groupPoll == nil) then _raidCDs_groupPoll = GetTime() if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: poll time is nil, setting poll start time\") end end        \n    if (GetTime() - _raidCDs_groupPoll < aura_env.pollRate) then return \"\" end\n    \n    _raidCDs_groupPoll = GetTime();\n    \n    if (InspectFrame ~= nil and InspectFrame:IsShown()) then if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: inspecting someone, ABORT\") end return \"\" end\n    \n    if (_raidCDs_groupPoll_state == nil) then _raidCDs_groupPoll_state = \"nextPlayer\" if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: state is nil, moving to nextPlayer\") end end\n    if (_raidCDs_groupPoll_playerCounter == nil) then _raidCDs_groupPoll_playerCounter = 0 if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: playerCounter is nil, setting to 0\") end end\n    \n    local playerCount = GetNumGroupMembers();\n    local _, _, _, _, maxPlayers = GetInstanceInfo();\n    local _, instanceType = IsInInstance();\n    \n    if (instanceType ~= \"none\") then\n        playerCount = math.min(playerCount, maxPlayers);\n        if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: in an instance, setting playerCount\") end\n    end    \n    \n    if (_raidCDs_groupPoll_state==\"pause\") then\n        return \"\"\n    end\n    \n    if (_raidCDs_groupPoll_state==\"inspectPlayer\") then   \n        \n        if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: state is inspectPlayer\") end\n        \n        local playerName = _raidCDs_groupPoll_currentPlayer\n        \n        if (not UnitInParty(\"player\")) and (_raidCDs_groupPoll_currentPlayer ~= UnitName(\"player\")) then\n            playerName = UnitName(\"player\")\n            if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: not in party and currentPlayer ~= player, setting playerName to player\") end\n        end\n        \n        if (not UnitInParty(playerName)) and playerName ~= UnitName(\"player\") then\n            if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: not in party and playerName ~= player, moving to nextPlayer\") end\n            _raidCDs_groupPoll_state = \"nextPlayer\";            \n            return \"\";\n        end\n        \n        local isPlayer = (playerName == UnitName(\"player\"));\n        local spec;\n        local specName; \n        \n        if (isPlayer) then         \n            spec = GetSpecialization();          \n        else\n            spec = GetInspectSpecialization(playerName);      \n        end        \n        \n        if (spec == nil) then\n            if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: spec is nil\") end\n            _raidCDs_groupPoll_state = \"nextPlayer\";\n            return \"\";\n        end        \n        \n        if(isPlayer) then\n            specName = GetSpecializationInfo(spec);\n        else\n            local role = GetSpecializationRoleByID(spec);\n            if(role ~= nil) then\n                specName = GetSpecializationInfoByID(spec);\n            end            \n        end       \n        \n        local _, race = UnitRace(playerName)\n        local _, _, class = UnitClass(playerName); \n        local activeSpec  = GetActiveSpecGroup(not isPlayer);        \n        \n        if (specName == nil) then\n            if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: specName is nil\") end\n            _raidCDs_groupPoll_state = \"nextPlayer\";\n            return \"\";\n        end\n        \n        if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: set inspected player data, adding CDs\") end\n        \n        if (race == \"BloodElf\") then\n            if TehrsCDs_show_Torrent then\n                if (_interrupts_belfs == nil) then _interrupts_belfs = {} end\n                if (_interrupts_belfs[playerName] == nil) then _interrupts_belfs[playerName] = {} end        \n                \n                if (_interrupts_belfs[playerName][\"Torrent\"] == nil) then\n                    _interrupts_belfs[playerName][\"Torrent\"] = GetTime();\n                end  \n            end            \n            if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: Added Blood Elf CD\") end\n        elseif (race == \"Tauren\") then\n            if TehrsCDs_show_Stomp then\n                if (_aoeCCs_tauren == nil) then _aoeCCs_tauren = {} end\n                if (_aoeCCs_tauren[playerName] == nil) then _aoeCCs_tauren[playerName] = {} end        \n                \n                if (_aoeCCs_tauren[playerName][\"Stomp\"] == nil) then\n                    _aoeCCs_tauren[playerName][\"Stomp\"] = GetTime();            \n                end\n            end\n            if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: Added Tauren CD\") end\n        end\n        \n        if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: Races completed\") end\n        \n        if (class == 1) then\n            if (_raidCDs_warriors == nil) then _raidCDs_warriors = {} end\n            if (_raidCDs_warriors[playerName] == nil) then _raidCDs_warriors[playerName] = {} end\n            if (_externCDs_warriors == nil) then _externCDs_warriors = {} end\n            if (_externCDs_warriors[playerName] == nil) then _externCDs_warriors[playerName] = {} end\n            if (_interrupts_warriors == nil) then _interrupts_warriors = {} end\n            if (_interrupts_warriors[playerName] == nil) then _interrupts_warriors[playerName] = {} end\n            if (_aoeCCs_warriors == nil) then _aoeCCs_warriors = {} end\n            if (_aoeCCs_warriors[playerName] == nil) then _aoeCCs_warriors[playerName] = {} end            \n            \n            if TehrsCDs_show_Pummel then\n                if (_interrupts_warriors[playerName][\"Pummel\"] == nil) then\n                    _interrupts_warriors[playerName][\"Pummel\"] = GetTime();\n                end\n            end\n            \n            if (specName == 73) then\n                local _, _, _, safeguardSpecced = GetTalentInfo(2, 3, activeSpec, not isPlayer, playerName);            \n                if (safeguardSpecced) then\n                    if TehrsCDs_show_Safeguard then\n                        if (_externCDs_warriors[playerName][\"Safeguard\"] == nil) then\n                            _externCDs_warriors[playerName][\"Safeguard\"] = GetTime();\n                        end    \n                    end    \n                else\n                    _externCDs_warriors[playerName][\"Safeguard\"] = nil;\n                end     \n                local _, _, _, shockwaveTANKSpecced = GetTalentInfo(1, 1, activeSpec, not isPlayer, playerName);            \n                if (shockwaveTANKSpecced) then\n                    if TehrsCDs_show_Shockwave then\n                        if (_aoeCCs_warriors[playerName][\"Shockwave\"] == nil) then\n                            _aoeCCs_warriors[playerName][\"Shockwave\"] = GetTime();\n                        end    \n                    end\n                else\n                    _aoeCCs_warriors[playerName][\"Shockwave\"] = nil;\n                end                   \n                _raidCDs_warriors[playerName][\"C-Shout\"] = nil;   \n            else       \n                local _, _, _, shockwaveDPSSpecced = GetTalentInfo(2, 1, activeSpec, not isPlayer, playerName);            \n                if (shockwaveDPSSpecced) then\n                    if TehrsCDs_show_Shockwave then\n                        if (_aoeCCs_warriors[playerName][\"Shockwave\"] == nil) then\n                            _aoeCCs_warriors[playerName][\"Shockwave\"] = GetTime();\n                        end  \n                    end\n                else\n                    _aoeCCs_warriors[playerName][\"Shockwave\"] = nil;\n                end   \n                if TehrsCDs_show_CShout then\n                    if (_raidCDs_warriors[playerName][\"C-Shout\"] == nil) then\n                        _raidCDs_warriors[playerName][\"C-Shout\"] = GetTime();\n                    end       \n                end\n                _externCDs_warriors[playerName][\"Safeguard\"] = nil;   \n            end\n            \n            if TehrsCDs_DEBUG and TehrsCDs_DEBUG_GroupPoll then print(\"GroupPoll: Added Warrior CDs\") end\n        elseif (class == 5) then\n            if (_raidCDs_priests == nil) then _raidCDs_priests = {} end\n            if (_raidCDs_priests[playerName] == nil) then _raidCDs_priests[playerName] = {} end\n            if (_externCDs_priests == nil) then _externCDs_priests = {} end\n            if (_externCDs_priests[playerName] == nil) then _externCDs_priests[playerName] = {} end\n            if (_interrupts_priests == nil) then _interrupts_priests = {} end\n            if (_interrupts_priests[playerName] == nil) then _interrupts_priests[playerName] = {} end\n            if (_utilityCDs_priests == nil) then _utilityCDs_priests = {} end\n            if (_utilityCDs_priests[playerName] == nil) then _utilityCDs_priests[playerName] = {} end    \n            if (_aoeCCs_priests == nil) then _aoeCCs_priests = {} end\n            if (_aoeCCs_priests[playerName] == nil) then _aoeCCs_priests[playerName] = {} end            \n            \n            if (specName == 257) then\n                local _, _, _, symbolOfHopeSpecced = GetTalentInfo(4, 3, activeSpec, not isPlayer, playerName);  \n                if (symbolOfHopeSpecced) then  \n                    if TehrsCDs_show_Hope then\n                        if (_utilityCDs_priests[playerName][\"Hope\"] == nil) then\n                            _utilityCDs_priests[playerName][\"Hope\"] = GetTime();\n                        end          \n                    end\n                else\n                    _utilityCDs_priests[playerName][\"Hope\"] = nil;\n                end\n                local _, _, _, guardianAngelSpecced = GetTalentInfo(4, 2, activeSpec, not isPlayer, playerName);  \n                if (guardianAngelSpecced) then     \n                    if TehrsCDs_show_GSpirit then\n                        if (_externCDs_priests[playerName][\"G-Spirit+\"] == nil) then\n                            _externCDs_priests[playerName][\"G-Spirit+\"] = GetTime();\n                        end    \n                    end\n                    _externCDs_priests[playerName][\"G-Spirit\"] = nil;                    \n                else\n                    if TehrsCDs_show_GSpirit then\n                        if (_externCDs_priests[playerName][\"G-Spirit\"] == nil) then\n                            _externCDs_priests[playerName][\"G-Spirit\"] = GetTime();\n                        end    \n                    end\n                    _externCDs_priests[playerName][\"G-Spirit+\"] = nil;\n                end   \n                if TehrsCDs_show_Grip then\n                    if (_utilityCDs_priests[playerName][\"Grip\"] == nil) then\n                        _utilityCDs_priests[playerName][\"Grip\"] = GetTime();\n                    end    \n                end\n                if TehrsCDs_show_DHymn then\n                    if (_raidCDs_priests[playerName][\"D-Hymn\"] == nil) then\n                        _raidCDs_priests[playerName][\"D-Hymn\"] = GetTime();\n                    end \n                end\n                _interrupts_priests[playerName][\"Silence\"] = nil;\n                _raidCDs_priests[playerName][\"VE\"] = nil;  \n                _raidCDs_priests[playerName][\"Barrier\"] = nil;\n                _raidCDs_priests[playerName][\"L-Wrath\"] = nil;\n                _externCDs_priests[playerName][\"P-Sup+\"] = nil;\n                _externCDs_priests[playerName][\"P-Sup\"] = nil;\n                _aoeCCs_priests[playerName][\"Mind Bomb\"] = nil;                \n            elseif (specName == 256) then    \n                if TehrsCDs_show_PSup then\n                    if GetInventoryItemID(playerName,9) == 132436 then\n                        if (_externCDs_priests[playerName][\"P-Sup+\"] == nil) then\n                            _externCDs_priests[playerName][\"P-Sup+\"] = GetTime();\n                        end \n                        _externCDs_priests[playerName][\"P-Sup\"] = nil;\n                    else\n                        if (_externCDs_priests[playerName][\"P-Sup\"] == nil) then\n                            _externCDs_priests[playerName][\"P-Sup\"] = GetTime();\n                        end \n                        _externCDs_priests[playerName][\"P-Sup+\"] = nil;\n                    end\n                end\n                if TehrsCDs_show_Barrier then\n                    if (_raidCDs_priests[playerName][\"Barrier\"] == nil) then\n                        _raidCDs_priests[playerName][\"Barrier\"] = GetTime();\n                    end  \n                end\n                if TehrsCDs_show_LWrath then\n                    if (_raidCDs_priests[playerName][\"L-Wrath\"] == nil) then\n                        _raidCDs_priests[playerName][\"L-Wrath\"] = GetTime();\n                    end  \n                end              