				["init"] = {
					["custom"] = "aura_env.trackedSpell = 236710 --236710 Shadow Reflection: Erupting; 194386 Volley\n\n\naura_env.npcBasehp = {\n    [\"96146\"] = 1510991, --test bear\n    [\"119206\"] = 156599904,--tos9 156599904\n}\n\naura_env.warningThresholds = {\n    [3] = true,\n    [2] = true,\n    [1] = true,\n}\n\n\n\naura_env.warn = function(number)\n    PlaySoundFile(\"Interface\\\\AddOns\\\\BigWigs\\\\Sounds\\\\David\\\\\"..number..\".ogg\", \"master\")\n    if number == 3 then\n        --red, green, blue, dur, alpha, repeatFlash\n        aura_env.flash:Show(1, 0, 0, 0.4, 0.3, 7)\n    end\n    \nend\n\n\n-- globals\naura_env.flash = {}\n-- locals\nlocal flashFrame = aura_env.flash\nlocal r, g, b, t, a\nlocal duration\nlocal elapsed = 0\nlocal totalRepeat = 0\n\n--------------------\n--  Create Frame  --\n--------------------\nlocal frame = CreateFrame(\"Frame\", \"WAFLASH\", UIParent)\nframe:Hide()\nframe:SetBackdrop({bgFile = \"Interface\\\\Tooltips\\\\UI-Tooltip-Background\",})\nframe:SetAllPoints(UIParent)\nframe:SetFrameStrata(\"BACKGROUND\")\n\n------------------------\n--  OnUpdate Handler  --\n------------------------\ndo\n    frame:SetScript(\"OnUpdate\", function(self, e)\n            elapsed = elapsed + e\n            if elapsed >= t then\n                self:Hide()\n                self:SetAlpha(0)\n                if totalRepeat >= 1 then--Keep repeating until totalRepeat = 0\n                    flashFrame:Show(r, g, b, t, a, totalRepeat-1)\n                end\n                return\n            end\n            -- quadratic fade in/out\n            self:SetAlpha(-(elapsed / (duration / 2) - 1)^2 + 1)\n    end)\n    frame:Hide()\nend\n\nfunction flashFrame:Show(red, green, blue, dur, alpha, repeatFlash)\n    r, g, b, t, a = red or 1, green or 0, blue or 0, dur or 0.4, alpha or 0.3\n    duration = dur\n    elapsed = 0\n    totalRepeat = repeatFlash or 0\n    frame:SetAlpha(0)\n    frame:SetBackdropColor(r, g, b, a)\n    frame:Show()\nend\n\nfunction flashFrame:IsShown()\n    return frame and frame:IsShown()\nend\n\nfunction flashFrame:Hide()\n    frame:Hide()\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
